import React, { useState } from 'react';
import Navbar from '../components/Navbar';


const Members = () => {

  //nav hamburger
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => {
      setIsOpen(!isOpen);
  };


  return (
    <>
      <Navbar toggle={toggle} />
    </>
  );
};

export default Members;
